import './index.css';

function Game(){
    return(
        <div>
            <Board />
        </div>
    );
}

function Board(){
    return(
        <>
            <div className='board-row'>
                <Square />
                <Square />
                <Square />
            </div>
            <div className='board-row'>
                <Square />
                <Square />
                <Square />
            </div>
            <div className='board-row'>
                <Square />
                <Square />
                <Square />
            </div>
        </>
    );
}

function Square(){
    return(
        <div className='square'>X</div>
    );
}

export default Game;
